import { Col, Row } from "react-bootstrap";

const OurWork = () => {
    return (
        <div className="ourName">
            <h3>We've made puzzles for movies, musicians and companies</h3>
            <div>
                <Row>
                    <Col>
                        <div></div>
                    </Col>
                    <Col>Test</Col>
                    <Col>Test</Col>
                </Row>
            </div>
        </div>
    );
}

export default OurWork;
